import React from "react";
import { Container } from "@material-ui/core";
import UserInfo from "./UserInfo";
import UserPostList from "./UserPostList";

const ProfileContaier = () => {
  return (
    <Container>
      <UserInfo />
      <UserPostList />
    </Container>
  );
};

export default ProfileContaier;
